import React from "react";


const InformationOfThePatiente = (props) => {
  const { info  } = props
  return (
    <div className="container divBorder">
        <label>Identity:</label>
        <input value={info.identity}></input>
        <label>Name:</label>
        <input value={info.identity}></input>
        <label>Identity:</label>
        <input value={info.name}></input>
        <label>Identity:</label>
        <input value={info.lastname}></input>
    </div>
  );
}

export default InformationOfThePatiente;
